import React from 'react';

function CallWindow({ onEndCall }) {
  return (
    <div className="fixed top-0 left-0 w-full h-full bg-black bg-opacity-80 flex items-center justify-center animate-slide-up z-50">
      <div className="bg-white rounded-xl p-8 max-w-md w-full text-center shadow-2xl">
        <h2 className="text-xl font-bold mb-4">Video Call</h2>
        <p className="text-sm text-gray-500 mb-6">Connecting...</p>
        <button
          onClick={onEndCall}
          className="px-4 py-2 bg-red-600 text-white rounded-lg hover:bg-red-700 transition"
        >
          End Call
        </button>
      </div>
    </div>
  );
}

export default CallWindow;
